class TablaHash {
    constructor(tamao = 10) {
        this.tamao = tamao;
        this.tabla = new Array(tamao);
        
        // Inicializar cada posicin como un arreglo vaco
        for (let i = 0; i < tamao; i++) {
            this.tabla[i] = [];
        }
    }
    
    // Funcin hash simple
    hash(clave) {
        let hash = 0;
        for (let i = 0; i < clave.length; i++) {
            hash += clave.charCodeAt(i);
        }
        return hash % this.tamao;
    }
    
    // Insertar par clave-valor - O(1) promedio
    insertar(clave, valor) {
        const indice = this.hash(clave);
        const bucket = this.tabla[indice];
        
        // Buscar si la clave ya existe
        for (let i = 0; i < bucket.length; i++) {
            if (bucket[i][0] === clave) {
                bucket[i][1] = valor; // Actualizar valor existente
                return;
            }
        }
        
        // Agregar nuevo par clave-valor
        bucket.push([clave, valor]);
    }
    
    // Buscar valor por clave - O(1) promedio
    buscar(clave) {
        const indice = this.hash(clave);
        const bucket = this.tabla[indice];
        
        for (let i = 0; i < bucket.length; i++) {
            if (bucket[i][0] === clave) {
                return bucket[i][1];
            }
        }
        
        return undefined;
    }
    
    // Eliminar par clave-valor - O(1) promedio
    eliminar(clave) {
        const indice = this.hash(clave);
        const bucket = this.tabla[indice];
        
        for (let i = 0; i < bucket.length; i++) {
            if (bucket[i][0] === clave) {
                bucket.splice(i, 1);
                return true;
            }
        }
        
        return false;
    }
    
    // Obtener todas las claves
    claves() {
        const claves = [];
        for (let bucket of this.tabla) {
            for (let par of bucket) {
                claves.push(par[0]);
            }
        }
        return claves;
    }
    
    // Mostrar estadsticas de la tabla
    estadisticas() {
        let elementosTotal = 0;
        let bucketsUsados = 0;
        let maxColisiones = 0;
        
        for (let bucket of this.tabla) {
            if (bucket.length > 0) {
                bucketsUsados++;
                elementosTotal += bucket.length;
                maxColisiones = Math.max(maxColisiones, bucket.length);
            }
        }
        
        return {
            elementos: elementosTotal,
            bucketsUsados,
            factorCarga: elementosTotal / this.tamao,
            maxColisiones
        };
    }
}

